import React from 'react';
import styled from 'styled-components';
import background from '../assets/bg.svg';

const Home = () => {
  return (
    <>
      <img src="../assets/bg.svg" width="100px" height="100px" />
      <HomeWrapper>Hello, world</HomeWrapper>
    </>
  );
};

const HomeWrapper = styled.div`
  color: black;
  font-size: 500px;
  width: 100vw;
  height: 100vh;
  background-image: url(''../assets/bg.svg');
`;

export default Home;
